import React from 'react';
import axios from 'axios';

function GetAccountById({userID=1}) {

    axios.get( 'http://localhost:8080/accounts/' + userID)
        .then(res=> {
            console.log(res.data)
        }).catch(err => {
            console.log(err)
        })
}

export default GetAccountById;
